import React from 'react';
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { loginUser, setCurrentUser } from "../../../actions/authAutentications";

//componenti da react-bootstrap
import { Navbar } from 'react-bootstrap';

//icone da material ui-icons
import PersonIcon from '@material-ui/icons/Person';
import { blue } from '@material-ui/core/colors';

//Componenti nostre
import Logo from '../../../immagini/logo.png'

let stile = 0;

if(this.props.auth.isAuthenticated){
    stile = 1;
}

class MyNavbar extends React.Component{ 
    constructor(props){ 
       super(props); 
    }
    render(){ 
        return( 
        <div>
            <Navbar className="Navbar">
                <Navbar.Brand href="/Login">
                <img
                src={Logo}
                width="50"
                height="50"
                alt="Karm-Logo"
                className="logo-navbar"
                />
                </Navbar.Brand>
                <Navbar.Toggle />
                <Navbar.Collapse className="justify-content-end">
                <a href="#login"><PersonIcon style={{ color: blue[50], fontSize: 30}}/></a>
                </Navbar.Collapse>
            </Navbar>
        </div>
       ); 
    }
 }

 MyNavbar.propTypes = {
    loginUser: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired,
    errors: PropTypes.object.isRequired
  };
  
  const mapStateToProps = state => ({
    auth: state.auth,
    errors: state.errors
  });
  
  export default connect(
    mapStateToProps,
    { loginUser }
  )(MyNavbar);
